import "./App.css";
import { Box, Flex } from "@chakra-ui/react";
import Navbar from "./Navbar";

function App() {
  return (
    <div className="App">
      <Flex>
        <Navbar />
        <Flex ml="200px" p={4} flex="1" flexDirection="column"></Flex>
      </Flex>
    </div>
  );
}

export default App;
